import React from 'react';

const Team = () => {
  return (
    <div className="team">
      <h1>Crea tu equipo</h1>
      <p>Aquí podrás seleccionar tus Pokémon favoritos para formar tu equipo.</p>
    </div>
  );
};

export default Team;
